class Solution(object):
    def repeatedSubstringPattern(self, s):
        """
        :type s: str
        :rtype: bool
        """
        n=len(s)
        for i in range(1, n // 2 + 1):
            if n % i == 0:
               substring = s[:i]
               if substring * (n // i) == s:
                 return True
        return False

#s =""

s="abcabcabc"
instance = Solution()
print(instance.repeatedSubstringPattern(s))  



